import { useSelector, useDispatch } from 'react-redux';
import { useState } from 'react';
import React from 'react';

export const Cal1 = (props) => {
    const dist = props.dist

    let [count, setCount] = useState(0)

    const add = () => {
        count = Number.parseInt(count) + dist
    }
    const sub = () => {
        count = Number.parseInt(count) - dist
    }
    return (
        <div>
            <h1>value {Number.parseInt(count)}</h1>
            <h1><button type="button" onClick={sub}>- {dist}</button>   
            <button type="button" onClick={add}>+ {dist}</button>         
            </h1>
        </div>
    );
};
